import React from 'react';
import Layout from '../Layout/Layout';
import './project.css';
import Card from '../Ui Kits/Cart/CT Card/Card';

function Project(props) {
  return (
    <div>
      <Layout>
        <div className='pr_main_div'>
          <h1>Project Category</h1>
          <div className='category'>
            <Card>
              key={props.id}
              imssrc={props.imssrc}
              catagry={props.catagry}
              title={props.title}
              link={props.link}
            </Card>
          </div>
        </div>
      </Layout>
    </div>
  );
}

export default Project;
